   [63]={next_id=64, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="开启巡礼，踏上朝圣路，从天兆之星那获得力量的馈赠，成为命星骑士……就像既定的故事那样，是一个完美的结局。", msg_color="", msg_size=0, talker="朝晖", audio="", img="arts/ui/bg/story/storybg_ACT203_108.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4520", 0, 0, 34, 220}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [64]={next_id=65, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="可是我的内心深处知道，我根本没有理解老师的话，我只是认为自己应该超过其他人，我比任何人都努力，从选拔中拿到优胜者是我应该做到的事情。", msg_color="", msg_size=0, talker="朝晖", audio="", img="arts/ui/bg/story/storybg_ACT203_108.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4520", 0, 0, 34, 220}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
