   [70]={next_id=71, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="阿戴妮，怪物要比我们强大太多……我走不掉了，其他人都走不掉了。", msg_color="", msg_size=0, talker="痛苦的声音", audio="", img="arts/ui/bg/story/storybg_1001.jpg", video_url="", music_id="69", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
