   [75]={next_id=76, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="我用老师赠予的剑砍碎了无数异变体，异变体却越来越多，将我们围困了起来。", msg_color="", msg_size=0, talker="朝晖", audio="", img="arts/ui/bg/story/storybg_ACT203_108.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4520", 0, 0, 34, 220}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
