   [79]={next_id=80, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="……但我没有时间去接受她们的死亡，星罚还未结束，我必须重回战场。", msg_color="", msg_size=0, talker="朝晖", audio="", img="arts/ui/bg/story/storybg_ACT203_108.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4520", 0, 0, 34, 220}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [80]={next_id=81, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="因为我是命星骑士，所以我会背负着她们的生命，以斩杀异变体来让她们的灵魂得以安息。", msg_color="", msg_size=0, talker="朝晖", audio="", img="arts/ui/bg/story/storybg_ACT203_108.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4520", 0, 0, 34, 220}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [81]={next_id=82, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="我不能因为这一次失败而就此消沉，还有更多的人需要我。", msg_color="", msg_size=0, talker="朝晖", audio="", img="arts/ui/bg/story/storybg_ACT203_108.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4520", 0, 0, 34, 220}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [82]={next_id=83, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="可那时的我……却怎么也没想到，命运会给我开第二个玩笑。", msg_color="", msg_size=0, talker="朝晖", audio="", img="arts/ui/bg/story/storybg_ACT203_108.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4520", 0, 0, 34, 220}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
